import { Card, Container, Grid } from "@mui/material";
import CustomCard from "./components/CustomCard";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <Header />
      <Container>
        <Grid container>
          <Grid item md={4} sm={6}>
            <CustomCard />
          </Grid>

        </Grid>
      </Container>
    </div>
  );
}

export default App;
